class ControlColor
{
    static Set(Control, Window, bc := "", tc := "", Redraw := True) {
        Local a := {}
        a.c := Control
        a.g := Window
        a.bc := (bc = "") ? "" : (((bc & 255) << 16) + (((bc >> 8) & 255) << 8) + (bc >> 16))
        a.tc := (tc = "") ? "" : (((tc & 255) << 16) + (((tc >> 8) & 255) << 8) + (tc >> 16))

            ControlColor.CC_WindowProc("Set", a, "", "")

            If (Redraw) {
                WinRedraw(, , "ahk_id " Control)
            }
    }


    static CC_WindowProc(hWnd, uMsg, wParam, lParam) {
        Local tc, bc, a
        Static Win := {}
        ; Critical

        If uMsg.c <= 0x138 && uMsg.c >= 0x132
        {
            If (Win[hWnd].HasKey(lParam)) {
                If (tc := Win[hWnd, lParam, "tc"]) {
                    DllCall("gdi32.dll\SetTextColor", "Ptr", wParam, "UInt", tc)
                }

                If (bc := Win[hWnd, lParam, "bc"]) {
                    DllCall("gdi32.dll\SetBkColor", "Ptr", wParam, "UInt", bc)
                }

                Return Win[hWnd, lParam, "Brush"] ; Return the HBRUSH to notify the OS that we altered the HDC.
            }


        }
        ; WM_CTLCOLOR(MSGBOX|EDIT|LISTBOX|BTN|DLG|SCROLLBAR|STATIC)

        If (hWnd == "Set") {
            a := uMsg
            Win[a.g, a.c] := a

            If ((Win[a.g, a.c, "tc"] == "") && (Win[a.g, a.c, "bc"] == "")) {
                Win[a.g].Remove(a.c, "")
            }

            If (!Win[a.g, "WindowProcOld"]) {
                Win[a.g, "WindowProcOld"] := DllCall("SetWindowLong" . (A_PtrSize == 8 ? "Ptr" : "")
                    , "Ptr", a.g, "Int", -4, "Ptr", CallbackCreate("CC_WindowProc", "", 4), "UPtr")
            }

            If (Win[a.g, a.c, "bc"] != "") {
                Win[a.g, a.c, "Brush"] := DllCall("gdi32.dll\CreateSolidBrush", "UInt", a.bc, "UPtr")
            }

            Return
        }
        Return DllCall("CallWindowProc", "Ptr", Win[hWnd, "WindowProcOld"], "Ptr", hWnd, "UInt", uMsg, "Ptr", wParam, "Ptr", lParam, "Ptr")
    }
}

/* C/C++ program to solve N Queen Problem using brute force */
#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>

#define N 8

void print(int board[N][N])
{
	for (int row = 0; row < N; row++) {
		for (int col = 0; col < N; col++) {
			printf(" %d", board[row][col]);
		}
		printf("\n");
	}
}

void zero(int board[N][N])
{
	for (int i = 0; i < N; i++)
		for (int j = 0; j < N; j++)
			board[i][j] = 0;
}

bool check(int board[N][N])
{
	int     queens[8] = { 8 };

	for (int col = 0; col < N; col++) {
		int     count = 0;

		for (int row = 0; row < N; row++) {
			if (board[row][col] == 1) {
				count++;
				if (count > 1)
					return false;

				queens[col] = row;
			}
		}
	}

	for (int i = 0; i < N - 1; i++) {
		for (int j = i + 1; j < N; j++) {
			if (abs(i - j) == abs(queens[i] - queens[j]))
				return false;
		}
	}
	return true;
}	/* check */

int main()
{
	int     count = 0;
	int     board[N][N];

	for (int a = 0; a < N; a++)
		for (int b = 0; b < N; b++)
			for (int c = 0; c < N; c++)
				for (int d = 0; d < N; d++)
					for (int e = 0; e < N; e++)
						for (int f = 0; f < N; f++)
							for (int g = 0; g < N; g++)
								for (int h = 0; h < N; h++) {
									zero(board);
									board[0][a] = 1;
									board[1][b] = 1;
									board[2][c] = 1;
									board[3][d] = 1;
									board[4][e] = 1;
									board[5][f] = 1;
									board[6][g] = 1;
									board[7][h] = 1;
									if (check(board)) {
										printf("solution: %d\n", ++count);
										print(board);
									}
								}
	return 0;
}	/* main */

class BasicPickerVC: UIViewController, UIPickerViewDataSource, UIPickerViewDelegate {
	
	let picker = UIPickerView()
	
	override func viewDidLoad() {
		super.viewDidLoad()
		
		self.view.addSubview(self.picker)

		// set frame near top-left
		picker.frame = .init(x: 60.0, y: 80.0, width: 240.0, height: 160.0)
		
		// we don't want any resizing o ndevice rotation
		picker.autoresizingMask = []
		
		// so we can see its frame
		picker.backgroundColor = .yellow

		self.picker.delegate = self
		self.picker.dataSource = self
	}
	
	override func viewSafeAreaInsetsDidChange() {
		super.viewSafeAreaInsetsDidChange()
		//This gets called everytime the device rotates, causing the picker view to redraw and reload all components. Trying to avoid this method being called.
		
		print ("viewSafeAreaInsetsDidChange")
		print (self.view.safeAreaInsets)
	}

	func numberOfComponents(in pickerView: UIPickerView) -> Int {
		print("num components: 1")
		return 1
	}
	
	func pickerView(_ pickerView: UIPickerView, numberOfRowsInComponent component: Int) -> Int {
		print("num rows: 30")
		return 30
	}
	
	func pickerView(_ pickerView: UIPickerView, titleForRow row: Int, forComponent component: Int) -> String? {
		print("Title for Row:", row)
		return "Row: \(row)"
	}
	
}

