$numbers = explode(" ", $inputStr);
$numbersCount = array();

foreach ($numbers as $number)
{

    if (array_key_exists($number, $numbersCount)){
        $numbersCount[$number]++;
    } else {
        $numbersCount[$number] = 1;
    }

}

$maxCount = max($numbersCount);
$maxFrequentNumbers = array();

foreach ($numbersCount as $number => $count)
{

    if ($count == $maxCount){
        $maxFrequentNumbers[] = $number;
    }

}

sort($maxFrequentNumbers);
